import "../styles/index.scss";

export const Menu = () => {
return (
<>
<header className="menu">
<a className="menu-link" >
<Route path = {home} element = {<Home />}/>
      <Route path = {profile} element = {<Profile />}/>
Home
</a>
<a className="menu-link" href="./pages/profile/index.js">
Profile
</a>
</header>
</>
);
};
